Here is a sample Spark job to calculate the hit rate for onsite attributed data:

```java
import org.apache.spark.api.java.JavaPairRDD;
import org.apache.spark.api.java.JavaRDD;
import org.apache.spark.api.java.function.Function;
import org.apache.spark.api.java.function.PairFunction;
import scala.Tuple2;

import java.sql.Timestamp;
import java.util.HashMap;
import java.util.Map;

public class HitRateCalculator {

    public static void main(String[] args) {
        // Create a SparkSession
        org.apache.spark.SparkConf conf = new org.apache.spark.SparkConf().setAppName("HitRateCalculator");
        org.apache.spark.api.java.JavaSparkContext sc = new org.apache.spark.api.java.JavaSparkContext(conf);
        org.apache.spark.api.java.JavaSparkContext jsc = new org.apache.spark.api.java.JavaSparkContext(sc);
        org.apache.spark.api.java.JavaPairRDD<String, Timestamp> onsiteAttributedData = jsc.textFile("path/to/onsite_attributed_data.txt")
                .mapToPair(new PairFunction<String, String, Timestamp>() {
                    @Override
                    public Tuple2<String, Timestamp> call(String line) {
                        String[] fields = line.split(",");
                        return new Tuple2<>(fields[0], new Timestamp(Long.parseLong(fields[1]) * 1000));
                    }
                });

        // Create a cache for top frequent queries
        Map<String, Timestamp> cache = new HashMap<>();

        // Create a function to check if a query is in the cache and update the timestamp
        Function<String, Tuple2<Boolean, Timestamp>> isInCacheAndUpdate = query -> {
            Timestamp currentTime = new Timestamp(System.currentTimeMillis());
            if (cache.containsKey(query)) {
                cache.put(query, currentTime);
                return new Tuple2<>(true, currentTime);
            } else {
                return new Tuple2<>(false, null);
            }
        };

        // Create a function to calculate hit rate for a given record
        Function<Tuple2<String, Timestamp>, Double> calculateHitRate = record -> {
            String query = record._1;
            Timestamp timestamp = record._2;
            if (cache.containsKey(query)) {
                Timestamp cacheTime = cache.get(query);
                long timeDifference = timestamp.getTime() - cacheTime.getTime();
                if (timeDifference <= 43200000) { // 12 hours in milliseconds
                    return 1.0; // hit
                } else {
                    cache.remove(query); // remove from cache if it's older than 12 hours
                }
            }
            return 0.0; // miss
        };

        // Calculate hit rate for each record in onsiteAttributedData
        JavaPairRDD<String, Double> hitRateRDD = onsiteAttributedData.mapValues(isInCacheAndUpdate)
                .join(onsiteAttributedData.mapValues(calculateHitRate))
                .values();

        // Calculate the average hit rate
        double averageHitRate = hitRateRDD.reduce((a, b) -> a + b) / hitRateRDD.count();
        System.out.println("Average hit rate: " + averageHitRate);

        // Save the cache for top frequent queries to a file for future use
        cache.entrySet().stream()
                .sorted((e1, e2) -> e1.getValue().compareTo(e2.getValue()))
                .limit(10) // limit to top 10
                .forEach(entry -> System.out.println(entry.getKey() + "," + entry.getValue().getTime()));
    }
}
```

