            'posts_per_page' => 5,
            'category'       => '',
            'taxonomy'       => '',
        ),
        $atts,
        'custom_posts'
    );

    // Query arguments
    $args = array(
        'post_type'      => $atts['post_type'],
        'posts_per_page' => $atts['posts_per_page'],
